#include <cmath>

class Solution {
public:
    int numberOfBeautifulIntegers(int low, int high, int k) {
        int count = 0;
        for (int num = low; num <= high; ++num) {
            if (num % k == 0 && hasEqualEvenOddDigits(num)) {
                ++count;
            }
        }
        return count;
    }

private:
    bool hasEqualEvenOddDigits(int num) {
        int evenDigits = 0, oddDigits = 0;
        while (num > 0) {
            int digit = num % 10;
            if (digit % 2 == 0) ++evenDigits;
            else ++oddDigits;
            num /= 10;
        }
        return evenDigits == oddDigits;
    }
};
